import React, { useState } from "react";
import Clock from "../media/clock.svg";
import Coins from "../media/coins.svg";
import Logo from "../media/logo.svg";
import { Link } from "react-router-dom";
import "../stylesheets/quizpage.css";

const PrimaryNavbar = () => {
  let [questionNumber, setQuestionNumber] = useState(1);
  return (
    <div className="PNNavbox">
      <div className="PNBox1">
        <Link to="/">
          <img src={Logo} alt="logo" />
        </Link>
        <div className="questionnobox">
          <span className="questionno1">{questionNumber + "/"}</span>
          <span className="questionno2">5</span>
        </div>
      </div>
      <div className="detailsbox">
        <div className="detail">
          <img src={Coins} align="left" alt="coins" />
          <span className="detailtext">1050</span>
        </div>
        <div className="detail">
          <img src={Clock} align="left" alt="Timer" />
          <span className="detailtext">4:50</span>
        </div>

        <div class="button">
          <span className="text-white">Exit</span>
        </div>
      </div>
    </div>
  );
};

export default PrimaryNavbar;
